import React from 'react';
import Layout from '../components/Layout'
const Login = () => {
    return (
        <>
            <Layout>
                <h1 className="text-center text-2xl text-white font-light">Login</h1>
                <div></div>
           
            </Layout>
        </>
      );
}
 
export default Login;
